<section class="login-color-bg bg-blue-light">
    <div class="col">
     <div class="login-boxWhite">
       <mat-card class="mat-elevation-z8">
         <div class="mat-headline">Login</div>
         <p>Hello! Log in with your email.</p>
         <mat-card-content>
           <form class="" action="" method="post">
             <mat-form-field appearance="outline" color="primary">
               <mat-label>Enter Your Email</mat-label>
               <input matInput placeholder="hint: email@example">
               <mat-icon matSuffix>mail</mat-icon>
             </mat-form-field>
             <mat-form-field appearance="outline" color="primary">
               <mat-label>Enter Your Password</mat-label>
               <input matInput placeholder="Hint: password@123" [type]="hide ? 'password' : 'text'">
               <button mat-icon-button matSuffix (click)="hide = !hide" [attr.aria-label]="'Hide password'"
                 [attr.aria-pressed]="hide">
                 <mat-icon>{{hide ? 'visibility_off' : 'visibility'}}</mat-icon>
               </button>
             </mat-form-field>
             <button mat-flat-button color="primary" class="w-100" type="Submit" name="Login">Login</button>
           </form>
         </mat-card-content>
         <mat-card-actions>
           <p>Don't have an account? <a routerLink="/registration" mat-button>Register</a></p>
         </mat-card-actions>
       </mat-card>
     </div>
   </div>
